import React, { Fragment } from 'react';

const Index = () => (
  <Fragment>
    <div id="content">
      <div className="left_content">content</div>
      <div className="right_content">profile</div>
    </div>
    <style jsx>
      {`
        #content{
          overflow:hidden;
        }
        .left_content{
          float:left
          width:50%;
          bacground-color:white;
          margin: 10px;
        }
        .right_content{
          float:left
          width:50%;  
          bacground-color:white;
        }
      `}
    </style>
  </Fragment>
);

export default Index;
